export class ReadonlyValue {
    constructor(value) {
        this.value_ = value;
    }
    static create(value) {
        return [
            new ReadonlyValue(value),
            (rawValue, options) => {
                value.setRawValue(rawValue, options);
            },
        ];
    }
    /**
     * The event emitter for value changes.
     */
    get emitter() {
        return this.value_.emitter;
    }
    /**
     * The raw value of the model.
     */
    get rawValue() {
        return this.value_.rawValue;
    }
}
